import './Partnerships.css'
import '../css/teams.css'
import React, { useState, useEffect } from 'react'; 

function Partnerships(props) {
    let url = "http://localhost:8000/match/" + props.m_id + "/"+props.inn_no + "/partnerships"
    const [data, setData] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
        const response = await fetch(url);
        const jsonData = await response.json();
        setData(jsonData);
        };

        fetchData();
    }, []);


    if (!data) {
        return <div>Loading...bowling_card</div>;
      }

    console.log(data)

    return (
        <div id="partnerships">
            {data.bowlers.map((bowler, index) => (
            <BowlerItem key={index} bowler={bowler} color={data.color}/>
            ))}
        </div>

    );
}

export default Partnerships;
